import{_ as e,o as a,c as t,O as n}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-6535 Supplemental funds.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-6535.md","filePath":"vacode/3.2-6535.md"}'),r={name:"vacode/3.2-6535.md"},i=n('<h1 id="§-3-2-6535-supplemental-funds" tabindex="-1">§ 3.2-6535 Supplemental funds. <a class="header-anchor" href="#§-3-2-6535-supplemental-funds" aria-label="Permalink to &quot;§ 3.2-6535 Supplemental funds.&quot;">​</a></h1><p>Localities may supplement the dog and cat license tax fund with other funds as they consider appropriate. Localities shall supplement the dog and cat license tax fund to the extent necessary to provide for the salary and expenses of the animal control officer and staff and the care and maintenance of a public animal shelter as provided in subdivisions 1 and 2 of § <a href="http://law.lis.virginia.gov/vacode/3.2-6534/" target="_blank" rel="noreferrer">3.2-6534</a>.</p><p>1984, c. 492, § 29-213.71; 1987, c. 488, § 3.1-796.102; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0817" target="_blank" rel="noreferrer">817</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0148" target="_blank" rel="noreferrer">148</a>.</p>',3),o=[i];function l(s,c,p,d,f,_){return a(),t("div",null,o)}const g=e(r,[["render",l]]);export{u as __pageData,g as default};
